import React from 'react'
import Link from 'next/link'
import {useRouter} from 'next/router'

const About = () => {
    const router = useRouter();
    console.log(router.query)
    return (
        <div>
            <h2>About us</h2>
            <Link href="/">
            <a>Home</a>
            </Link>
        </div>
    )
}

export default About;
